import React, { lazy } from "react";
import { Browser as Router, Route, Switch } from "react-router-dom";

const Login = lazy(() => import("./pages/login"));

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/login" component />
      </Switch>
    </Router>
  );
}

export default App;
